description:
9X Jhakaas Tu


* Singer / Lyrics / Composer - Vaibhav Londhe
* Music Video Director - Rahul R. Zende
* DoP - Siddhart Mitragotri
* Exe. Producers - Kuldip Singh Latt &amp; Abhishek Jadhav

9X Jhakaas is Maharastra's first Marathi music channel that airs the best Marathi songs with humorous animated shows featuring the characters Chote Bade, Surmai and Chochya.
For more Marathi Music and Masti,
Website : www.9xjhakaas.in or 
FB : fb/9xjhakaas.in
Twitter : @9XJhakaas

